@testset "4.5.3.1 (a+b sec)^m (d sec)^n (A+B sec)" begin
    @variables A, B, a, b, c, d, e, f, m, n, x

    #= ::Package:: =#

    #= ::Title::Closed:: =#
    #=Integrands*of*the*form*(b*sec(e+f*x))^m*(d*sec(e+f*x))^n*(A+B*sec(e+f*x))=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a*sec(c+d*x))^m*(b*sec(c+d*x))^n*(A+B*sec(c+d*x))=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sec(c+d*x)^m*(A+B*sec(c+d*x))*(b*sec(c+d*x))^(n/2)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sec(c + d*x)^0*(b*sec(c + d*x))^(5/2)*(A + B*sec(c + d*x)), x, 8, -((6*b^3*B*EllipticE((1/2)*(c + d*x), 2))/(5*d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x)))) + (2*A*b^2*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/(3*d) + (6*b^2*B*sqrt(b*sec(c + d*x))*sin(c + d*x))/(5*d) + (2*A*b*(b*sec(c + d*x))^(3/2)*sin(c + d*x))/(3*d) + (2*B*(b*sec(c + d*x))^(5/2)*sin(c + d*x))/(5*d)]
    @test_int [sec(c + d*x)^0*(b*sec(c + d*x))^(3/2)*(A + B*sec(c + d*x)), x, 7, -((2*A*b^2*EllipticE((1/2)*(c + d*x), 2))/(d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x)))) + (2*b*B*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/(3*d) + (2*A*b*sqrt(b*sec(c + d*x))*sin(c + d*x))/d + (2*B*(b*sec(c + d*x))^(3/2)*sin(c + d*x))/(3*d)]
    @test_int [sec(c + d*x)^0*(b*sec(c + d*x))^(1/2)*(A + B*sec(c + d*x)), x, 6, -((2*b*B*EllipticE((1/2)*(c + d*x), 2))/(d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x)))) + (2*A*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/d + (2*B*sqrt(b*sec(c + d*x))*sin(c + d*x))/d]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [sec(c + d*x)^0*(A + B*sec(c + d*x))/(b*sec(c + d*x))^(1/2), x, 5, (2*A*EllipticE((1/2)*(c + d*x), 2))/(d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x))) + (2*B*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/(b*d)]
    @test_int [sec(c + d*x)^0*(A + B*sec(c + d*x))/(b*sec(c + d*x))^(3/2), x, 6, (2*B*EllipticE((1/2)*(c + d*x), 2))/(b*d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x))) + (2*A*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/(3*b^2*d) + (2*A*sin(c + d*x))/(3*b*d*sqrt(b*sec(c + d*x)))]
    @test_int [sec(c + d*x)^0*(A + B*sec(c + d*x))/(b*sec(c + d*x))^(5/2), x, 7, (6*A*EllipticE((1/2)*(c + d*x), 2))/(5*b^2*d*sqrt(cos(c + d*x))*sqrt(b*sec(c + d*x))) + (2*B*sqrt(cos(c + d*x))*EllipticF((1/2)*(c + d*x), 2)*sqrt(b*sec(c + d*x)))/(3*b^3*d) + (2*A*sin(c + d*x))/(5*b*d*(b*sec(c + d*x))^(3/2)) + (2*B*sin(c + d*x))/(3*b^2*d*sqrt(b*sec(c + d*x)))]


    #= ::Subsection:: =#
    #=Integrands*of*the*form*sec(c+d*x)^(m/2)*(A+B*sec(c+d*x))*(b*sec(c+d*x))^(n/2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sec(c+d*x)^m*(A+B*sec(c+d*x))*(b*sec(c+d*x))^(n/3)=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [sec(c + d*x)^2*(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 6, (3*A*Hypergeometric2F1(-(5/6), 1/2, 1/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(5/3)*sin(c + d*x))/(5*b*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(4/3), 1/2, -(1/3), cos(c + d*x)^2)*(b*sec(c + d*x))^(8/3)*sin(c + d*x))/(8*b^2*d*sqrt(sin(c + d*x)^2))]
    @test_int [sec(c + d*x)*(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 6, (3*A*Hypergeometric2F1(-(1/3), 1/2, 2/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(2*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(5/6), 1/2, 1/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(5/3)*sin(c + d*x))/(5*b*d*sqrt(sin(c + d*x)^2))]
    @test_int [(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 5, -((3*A*b*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(-(1/3), 1/2, 2/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(2*d*sqrt(sin(c + d*x)^2))]
    @test_int [cos(c + d*x)*(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*b^2*Hypergeometric2F1(1/2, 2/3, 5/3, cos(c + d*x)^2)*sin(c + d*x))/(4*d*(b*sec(c + d*x))^(4/3)*sqrt(sin(c + d*x)^2))) - (3*b*B*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))]
    @test_int [cos(c + d*x)^2*(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*b^3*Hypergeometric2F1(1/2, 7/6, 13/6, cos(c + d*x)^2)*sin(c + d*x))/(7*d*(b*sec(c + d*x))^(7/3)*sqrt(sin(c + d*x)^2))) - (3*b^2*B*Hypergeometric2F1(1/2, 2/3, 5/3, cos(c + d*x)^2)*sin(c + d*x))/(4*d*(b*sec(c + d*x))^(4/3)*sqrt(sin(c + d*x)^2))]


    @test_int [sec(c + d*x)^2*(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 6, (3*A*Hypergeometric2F1(-(7/6), 1/2, -(1/6), cos(c + d*x)^2)*(b*sec(c + d*x))^(7/3)*sin(c + d*x))/(7*b*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(5/3), 1/2, -(2/3), cos(c + d*x)^2)*(b*sec(c + d*x))^(10/3)*sin(c + d*x))/(10*b^2*d*sqrt(sin(c + d*x)^2))]
    @test_int [sec(c + d*x)*(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 6, (3*A*Hypergeometric2F1(-(2/3), 1/2, 1/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(4/3)*sin(c + d*x))/(4*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(7/6), 1/2, -(1/6), cos(c + d*x)^2)*(b*sec(c + d*x))^(7/3)*sin(c + d*x))/(7*b*d*sqrt(sin(c + d*x)^2))]
    @test_int [(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 5, (3*A*b*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(2/3), 1/2, 1/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(4/3)*sin(c + d*x))/(4*d*sqrt(sin(c + d*x)^2))]
    @test_int [cos(c + d*x)*(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*b^2*Hypergeometric2F1(1/3, 1/2, 4/3, cos(c + d*x)^2)*sin(c + d*x))/(2*d*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))) + (3*b*B*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*sqrt(sin(c + d*x)^2))]
    @test_int [cos(c + d*x)^2*(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*b^3*Hypergeometric2F1(1/2, 5/6, 11/6, cos(c + d*x)^2)*sin(c + d*x))/(5*d*(b*sec(c + d*x))^(5/3)*sqrt(sin(c + d*x)^2))) - (3*b^2*B*Hypergeometric2F1(1/3, 1/2, 4/3, cos(c + d*x)^2)*sin(c + d*x))/(2*d*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [(sec(c + d*x)^2*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(2/3), x, 6, (3*A*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(b*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(2/3), 1/2, 1/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(4/3)*sin(c + d*x))/(4*b^2*d*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(2/3), x, 6, -((3*A*Hypergeometric2F1(1/3, 1/2, 4/3, cos(c + d*x)^2)*sin(c + d*x))/(2*d*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(b*d*sqrt(sin(c + d*x)^2))]
    @test_int [(A + B*sec(c + d*x))/(b*sec(c + d*x))^(2/3), x, 5, -((3*A*b*Hypergeometric2F1(1/2, 5/6, 11/6, cos(c + d*x)^2)*sin(c + d*x))/(5*d*(b*sec(c + d*x))^(5/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/3, 1/2, 4/3, cos(c + d*x)^2)*sin(c + d*x))/(2*d*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(2/3), x, 6, -((3*A*Hypergeometric2F1(1/3, 1/2, 4/3, cos(c + d*x)^2)*sin(c + d*x))/(2*d*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(b*d*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)^2*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(2/3), x, 6, (3*A*Hypergeometric2F1(-(1/6), 1/2, 5/6, cos(c + d*x)^2)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(b*d*sqrt(sin(c + d*x)^2)) + (3*B*Hypergeometric2F1(-(2/3), 1/2, 1/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(4/3)*sin(c + d*x))/(4*b^2*d*sqrt(sin(c + d*x)^2))]


    @test_int [(sec(c + d*x)^2*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(4/3), x, 6, -((3*A*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(b*d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(-(1/3), 1/2, 2/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(2*b^2*d*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(4/3), x, 6, -((3*A*Hypergeometric2F1(1/2, 2/3, 5/3, cos(c + d*x)^2)*sin(c + d*x))/(4*d*(b*sec(c + d*x))^(4/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(b*d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(A + B*sec(c + d*x))/(b*sec(c + d*x))^(4/3), x, 5, -((3*A*b*Hypergeometric2F1(1/2, 7/6, 13/6, cos(c + d*x)^2)*sin(c + d*x))/(7*d*(b*sec(c + d*x))^(7/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/2, 2/3, 5/3, cos(c + d*x)^2)*sin(c + d*x))/(4*d*(b*sec(c + d*x))^(4/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(4/3), x, 6, -((3*A*Hypergeometric2F1(1/2, 2/3, 5/3, cos(c + d*x)^2)*sin(c + d*x))/(4*d*(b*sec(c + d*x))^(4/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(b*d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)^2*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(4/3), x, 6, -((3*A*Hypergeometric2F1(1/6, 1/2, 7/6, cos(c + d*x)^2)*sin(c + d*x))/(b*d*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(-(1/3), 1/2, 2/3, cos(c + d*x)^2)*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(2*b^2*d*sqrt(sin(c + d*x)^2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sec(c+d*x)^m*(A+B*sec(c+d*x))*(b*sec(c+d*x))^n*with*m*symbolic=#


    @test_int [sec(c + d*x)^m*(b*sec(c + d*x))^(4/3)*(A + B*sec(c + d*x)), x, 6, (3*A*b*Hypergeometric2F1(1/2, (1/6)*(-1 - 3*m), (1/6)*(5 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^m*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*(1 + 3*m)*sqrt(sin(c + d*x)^2)) + (3*b*B*Hypergeometric2F1(1/2, (1/6)*(-4 - 3*m), (1/6)*(2 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(1 + m)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*(4 + 3*m)*sqrt(sin(c + d*x)^2))]
    @test_int [sec(c + d*x)^m*(b*sec(c + d*x))^(2/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*Hypergeometric2F1(1/2, (1/6)*(1 - 3*m), (1/6)*(7 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(d*(1 - 3*m)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(1/2, (1/6)*(-2 - 3*m), (1/6)*(4 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^m*(b*sec(c + d*x))^(2/3)*sin(c + d*x))/(d*(2 + 3*m)*sqrt(sin(c + d*x)^2))]
    @test_int [sec(c + d*x)^m*(b*sec(c + d*x))^(1/3)*(A + B*sec(c + d*x)), x, 6, -((3*A*Hypergeometric2F1(1/2, (1/6)*(2 - 3*m), (1/6)*(8 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*(2 - 3*m)*sqrt(sin(c + d*x)^2))) + (3*B*Hypergeometric2F1(1/2, (1/6)*(-1 - 3*m), (1/6)*(5 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^m*(b*sec(c + d*x))^(1/3)*sin(c + d*x))/(d*(1 + 3*m)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)^m*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(1/3), x, 6, -((3*A*Hypergeometric2F1(1/2, (1/6)*(4 - 3*m), (1/6)*(10 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*sin(c + d*x))/(d*(4 - 3*m)*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/2, (1/6)*(1 - 3*m), (1/6)*(7 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^m*sin(c + d*x))/(d*(1 - 3*m)*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)^m*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(2/3), x, 6, -((3*A*Hypergeometric2F1(1/2, (1/6)*(5 - 3*m), (1/6)*(11 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*sin(c + d*x))/(d*(5 - 3*m)*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/2, (1/6)*(2 - 3*m), (1/6)*(8 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^m*sin(c + d*x))/(d*(2 - 3*m)*(b*sec(c + d*x))^(2/3)*sqrt(sin(c + d*x)^2))]
    @test_int [(sec(c + d*x)^m*(A + B*sec(c + d*x)))/(b*sec(c + d*x))^(4/3), x, 6, -((3*A*Hypergeometric2F1(1/2, (1/6)*(7 - 3*m), (1/6)*(13 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-2 + m)*sin(c + d*x))/(b*d*(7 - 3*m)*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))) - (3*B*Hypergeometric2F1(1/2, (1/6)*(4 - 3*m), (1/6)*(10 - 3*m), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*sin(c + d*x))/(b*d*(4 - 3*m)*(b*sec(c + d*x))^(1/3)*sqrt(sin(c + d*x)^2))]


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*sec(c+d*x)^m*(A+B*sec(c+d*x))*(b*sec(c+d*x))^n*with*n*symbolic=#


    @test_int [sec(c + d*x)^m*(b*sec(c + d*x))^n*(A + B*sec(c + d*x)), x, 6, -((A*Hypergeometric2F1(1/2, (1/2)*(1 - m - n), (1/2)*(3 - m - n), cos(c + d*x)^2)*sec(c + d*x)^(-1 + m)*(b*sec(c + d*x))^n*sin(c + d*x))/(d*(1 - m - n)*sqrt(sin(c + d*x)^2))) + (B*Hypergeometric2F1(1/2, (1/2)*(-m - n), (1/2)*(2 - m - n), cos(c + d*x)^2)*sec(c + d*x)^m*(b*sec(c + d*x))^n*sin(c + d*x))/(d*(m + n)*sqrt(sin(c + d*x)^2))]


    @test_int [sec(c + d*x)^2*(b*sec(c + d*x))^n*(A + B*sec(c + d*x)), x, 6, (A*Hypergeometric2F1(1/2, (1/2)*(-1 - n), (1 - n)/2, cos(c + d*x)^2)*(b*sec(c + d*x))^(1 + n)*sin(c + d*x))/(b*d*(1 + n)*sqrt(sin(c + d*x)^2)) + (B*Hypergeometric2F1(1/2, (1/2)*(-2 - n), -(n/2), cos(c + d*x)^2)*(b*sec(c + d*x))^(2 + n)*sin(c + d*x))/(b^2*d*(2 + n)*sqrt(sin(c + d*x)^2))]
    @test_int [sec(c + d*x)*(b*sec(c + d*x))^n*(A + B*sec(c + d*x)), x, 6, (A*Hypergeometric2F1(1/2, -(n/2), (2 - n)/2, cos(c + d*x)^2)*(b*sec(c + d*x))^n*sin(c + d*x))/(d*n*sqrt(sin(c + d*x)^2)) + (B*Hypergeometric2F1(1/2, (1/2)*(-1 - n), (1 - n)/2, cos(c + d*x)^2)*(b*sec(c + d*x))^(1 + n)*sin(c + d*x))/(b*d*(1 + n)*sqrt(sin(c + d*x)^2))]
    @test_int [(b*sec(c + d*x))^n*(A + B*sec(c + d*x)), x, 5, -((A*b*Hypergeometric2F1(1/2, (1 - n)/2, (3 - n)/2, cos(c + d*x)^2)*(b*sec(c + d*x))^(-1 + n)*sin(c + d*x))/(d*(1 - n)*sqrt(sin(c + d*x)^2))) + (B*Hypergeometric2F1(1/2, -(n/2), (2 - n)/2, cos(c + d*x)^2)*(b*sec(c + d*x))^n*sin(c + d*x))/(d*n*sqrt(sin(c + d*x)^2))]
